import NAME from "./NameSP";
import IMG from "./ImageSP";
function LoaiSP(truyen){
    return(
        
        <>
        
        
        <div class="col-sm-3">
            <div class="SanPham">
            <IMG url={truyen.member.IMGSP} />
            <NAME nm={truyen.member.NameSP} />
            <Price pr={truyen.member.PriceSP}/>
            <button type="Submit">BUY</button>
            </div>
        </div>
        
   
        </>
    );
}
export default LoaiSP;
